import { useContext } from 'react';

import './Bar.css';

import { NoteCard } from '../NoteCard';
import { ProgContext } from '../ModeContext';

export const Bar = () => {

  const items = useContext(ProgContext).items;
  console.log(items);

  return (
    <div className='bar barBlur'>
      {({items}: any) => items.map((chord: any) => <NoteCard chord={chord}/>)}
      <div className='emptyCard'>+</div>
    </div>
  );
}
